module.exports = {
  extends: ['@commitlint/config-conventional'],
  rules: {
    'scope-enum': [
      2,
      'always',
      ['devtools', 'devtools/build', 'docs', 'metrics_server', 'sentry_webhook', 'server'],
    ],
  },
};

{
  "spec_dir": ".",
  "spec_files": ["build/js/**/*.spec.js"],
  "stopSpecOnExpectationFailure": false,
  "random": false
}

